import React from 'react';
import styled from 'styled-components';
import Section from './Section';
import Navbar from '../Dashboard/index';
import {BrowserRouter as Router,Route} from 'react-router-dom'
import Nav from './Nav';
import Qa from './Qa';
import Qatrending from './Qatrending';
import Qamytasks from './Qamytasks';
import Qamyupdate from './Qamyupdates';
import QaEdjucation from './QaEdjucation';
import QaTechnology from './QaTechnology';
import QaNutrition from './QaNutrition';
import QaSocial from './QaSocial';
import QaBooks from './QaBooks';
import QaWeather from './Qaweather';
//import Profile from './Profile';
//import Questionlist from './QuestionList';


function Homepage() {


  return (
    <Router>
    <Container >

      <Nav />
      <Navbar />
      <Section />
      <Route path="/Homepage">
      <Qa/>
      </Route>
      <Route path="/trendingTask">
      <Qa/>
      </Route>

      <Route path="/myTasks">
      <Qamytasks/>
      </Route>

      <Route path="/myupdates">
      <Qamyupdate/>
        </Route>
        <Route path="/educationTask">
        <QaEdjucation/>
        </Route>
        <Route path="/weatherTask">
        <QaWeather/>
        </Route>
        <Route path="/NutritionTask">
        <QaNutrition/>
        </Route>
        <Route path="/TechnologyTask">
        <QaTechnology/>
        </Route>
        <Route path="/SocialTask">
        <QaSocial/>
        </Route>
        <Route path="/BookTask">
        <QaBooks/>
        </Route>



    </Container>
    </Router>


  );
}

export default Homepage;

const Container = styled.div`
position: absolute;
width: 100%;
height: 100%;
min-height: 900px;
background-repeat: no-repeat;
background-size: cover;

`;
